// src/components/staff/StaffList.js
import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Button,
  Paper,
  Box,
  IconButton,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions
} from '@mui/material';
import { DataGrid } from '@mui/x-data-grid';
import { Edit, Delete, Download, Add } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import ApiService from '../../services/api';

const StaffList = () => {
  const [staff, setStaff] = useState([]);
  const [loading, setLoading] = useState(true);
  const [deleteDialog, setDeleteDialog] = useState({ open: false, staffId: null });
  const navigate = useNavigate();

  useEffect(() => {
    loadStaff();
  }, []);

  const loadStaff = async () => {
    try {
      const data = await ApiService.getAllStaff();
      setStaff(data.staff);
    } catch (error) {
      console.error('Failed to load staff:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async () => {
    try {
      await ApiService.deleteStaff(deleteDialog.staffId);
      setDeleteDialog({ open: false, staffId: null });
      loadStaff();
    } catch (error) {
      console.error('Failed to delete staff:', error);
    }
  };

  const handleDownload = async (staffId) => {
    try {
      const blob = await ApiService.downloadProofOfId(staffId);
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = `proof_of_id_${staffId}.jpg`;
      a.click();
    } catch (error) {
      console.error('Failed to download file:', error);
    }
  };

  const columns = [
    { field: 'firstname', headerName: 'First Name', width: 130 },
    { field: 'lastname', headerName: 'Last Name', width: 130 },
    { field: 'email', headerName: 'Email', width: 200 },
    { field: 'phone', headerName: 'Phone', width: 130 },
    { field: 'employment_status', headerName: 'Status', width: 120 },
    {
      field: 'actions',
      headerName: 'Actions',
      width: 200,
      renderCell: (params) => (
        <Box>
          <IconButton onClick={() => navigate(`/staff/edit/${params.row.id}`)}>
            <Edit />
          </IconButton>
          <IconButton onClick={() => setDeleteDialog({ open: true, staffId: params.row.id })}>
            <Delete />
          </IconButton>
          {params.row.proof_of_id && (
            <IconButton onClick={() => handleDownload(params.row.id)}>
              <Download />
            </IconButton>
          )}
        </Box>
      )
    }
  ];

  return (
    <Container maxWidth="lg" sx={{ mt: 4 }}>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 4 }}>
        <Typography variant="h4">Staff Management</Typography>
        <Button
          variant="contained"
          startIcon={<Add />}
          onClick={() => navigate('/staff/add')}
        >
          Add Staff
        </Button>
      </Box>

      <Paper>
        <DataGrid
          rows={staff}
          columns={columns}
          loading={loading}
          autoHeight
          pageSize={10}
          disableSelectionOnClick
        />
      </Paper>

      <Dialog open={deleteDialog.open} onClose={() => setDeleteDialog({ open: false, staffId: null })}>
        <DialogTitle>Confirm Delete</DialogTitle>
        <DialogContent>
          Are you sure you want to delete this staff member?
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDeleteDialog({ open: false, staffId: null })}>Cancel</Button>
          <Button onClick={handleDelete} color="error">Delete</Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default StaffList;
